import React from 'react'
import {useRouter} from 'next/router'

const  route = [
    {name:"abuchi", age:"32"},
    {name:"Onyeka", age:"30"},
    {name:"Kenchi", age:"30"},
    {name:"Amaka", age:"22"}
]

function sec() {
    const router = useRouter()

    return (
        <div>
            <h2>{router.query.name} {router.query.age} </h2>
        </div>
    )
}

export default sec
